import logo from "./logo.svg";
import "./App.css";
import { Button, Typography, Layout, Menu, Icon } from "antd";
import React, { Component } from "react";

import ProfilePic from "./raghu.jpg";
const { Title } = Typography;
const { Header, Content, Footer, Sider } = Layout;

class App extends Component {
  handleItemClick = (e, { name }) => this.setState({ activeItem: name });

  render() {
    return (
      <div className="background-image App App-header">
        <Layout>
          <Sider
            breakpoint="lg"
            collapsedWidth="0"
            onBreakpoint={broken => {
              console.log(broken);
            }}
            onCollapse={(collapsed, type) => {
              console.log(collapsed, type);
            }}
          >
            <div className="logo" />
            <Menu theme="dark" mode="inline" defaultSelectedKeys={["4"]}>
              <Menu.Item key="1">
                <Icon type="user" />
                <span className="nav-text">nav 1</span>
              </Menu.Item>
              <Menu.Item key="2">
                <Icon type="video-camera" />
                <span className="nav-text">nav 2</span>
              </Menu.Item>
              <Menu.Item key="3">
                <Icon type="upload" />
                <span className="nav-text">nav 3</span>
              </Menu.Item>
              <Menu.Item key="4">
                <Icon type="user" />
                <span className="nav-text">nav 4</span>
              </Menu.Item>
            </Menu>
          </Sider>
          <Layout>
            <Header style={{ background: "#fff", padding: 0 }} />
            <Content className="background-image App App-header">
              <img
                src={ProfilePic}
                height="300px"
                style={{ borderRadius: "10%", boxShadow: "2px 2px 40px black" }}
              />
              <Title style={{ color: "white" }}>Shri Raghu Raaman</Title>
            </Content>
            <Footer style={{ textAlign: "center" }}>
              Ant Design Â©2018 Created by Ant UED
            </Footer>
          </Layout>
        </Layout>
      </div>
    );
  }
}

export default App;
